import styled from "styled-components"
import wave from "../../assets/wave.png"

export default function WaveHeightDirection({ waveHeight, currentDirection }) {
    const waveH = [];
    const waveD = [];
    const waveArr = [wave, wave, wave, wave];

    for (let i = 0; i < waveHeight.length; i++) {
        let obj = { heigth: waveHeight[i] }
        waveH.push(obj);
    }
    for (let i = 0; i < currentDirection.length; i++) {
        let obj = { direction: currentDirection[i] }
        waveD.push(obj);
    }
    console.log(waveD)
    return (
        <Content>
            <>
            {waveArr.map((value,index)=>{
                <Wave
                key={index}
                />
            })}
            </>
            <>
                {waveH.map((value, index) => (
                    <WHeight
                        key={index}
                        heigth={value.heigth}
                    />
                ))}
                {waveD.map((value, index) => (
                    <WDirection
                        key={index}
                        direction={value.direction}
                    />
                ))}
            </>
        </Content>
    )
}
function Wave(){
    return(
        <img src={wave}/>
    )
}

function WHeight({ heigth }) {
    console.log(heigth)
    return (
        <>{heigth}</>
    )
}
function WDirection({ direction }) {
    return (
        <>{direction}</>
    )
}

const Content = styled.div`
border: 2px solid purple;
`
